import React from "react";

const styles = {
  right: {
    backgroundColor: "white",
    height: "100vh",
    width: "50%",
    display: "flex",
    flexDirection: "column",
    aligntItems: "center",
  },

  box: {
    border: "1px solid black",
  },
};

function Works() {
  return (
    <div style={styles.right}>
      <div style={styles.box}>Hello</div>
      <div style={styles.box}>Hello</div>
    </div>
  );
}

export default Works;
